import { Navigate, useNavigate } from "react-router-dom"
import { useEffect } from "react"

export function NotFound(){

    const navigate = useNavigate()

    useEffect(() => {
        setTimeout(() => {
            navigate(-1)
        },2000)
    },[]) 

    return <h1> Not Found - Redirect in 2 seconds</h1>
    // <Navigate to="/" />
}
